const canvas = document.getElementById('canvas2');
const context = canvas.getContext('2d');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
let particleArray = [];
let particleMouseArray = [];

const vyImage = new Image();
vyImage.src = 'data:image/jpeg;base64,';

//handle mouse
const mouse = {
    x: null,
    y: null,
    radius: 110
};

let canvasData = null;

window.addEventListener('mousemove', function(event){
    mouse.x = event.x;
    mouse.y = event.y;
    particleOnMouse(event);
})

window.addEventListener('touchmove', function(event){
    mouse.x = event.changedTouches[0].clientX;
    mouse.y = event.changedTouches[0].clientY;
})

const textImage = {
    width: vyImage.width/20,
    height: vyImage.height/20
};

function drawText(){
    context.fillStyle = 'white';
    context.font = '35px Verdana';
    context.fillText('A', 5, 40);
    canvasData = context.getImageData(0, 0, textImage.width, textImage.height);
}
//drawText();

function drawImage(){
    context.drawImage(vyImage, 0, 0, textImage.width, textImage.height);
    canvasData = context.getImageData(0, 0, textImage.width, textImage.height);
}

function particleOnMouse(event){
    for(let i = 0; i < 5; i++){
        particleMouseArray.push(new ParticleMouse(event.x, event.y));
    }
}

let hue = 0;
class ParticleMouse{
    constructor(x, y){
        this.x = x;
        this.y = y;
        this.baseX = this.x;
        this.baseY = this.y;
        this.size = Math.random() * 10 + 2;
        this.baseSize = this.size;
        this.speedX = Math.random() * 3 - 1.5;
        this.speedY = Math.random() * 3 - 1.5;
        this.color = 'hsl(' + hue + ',100%,50%)';
        //this.hueOperator = '+';
    }

    draw(){
        context.fillStyle = this.color;
        context.beginPath();
        context.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        context.closePath();
        context.fill();
    }

    update(){
        /*if(this.hue >= 360){
            this.hueOperator = '-';
        }
        if(this.hueOperator == '-'){
            this.hue -= 5;
            if(this.hue < 0){
                this.hue = 0;
                this.hueOperator = '+';
            }
        }else{
            this.hue += 5;
        }*/
        context.fillStyle = 'hsl(' + this.hue + ', 100%, 50%)';
        this.size -= 0.1;
        this.x += this.speedX;
        this.y += this.speedY;
    }
}


