class Particle{
    constructor(x, y, color){
        this.x = x;
        this.y = y;
        this.size = 3;
        this.baseX = x;
        this.baseY = y;
        this.density = (Math.random() * 30) + 1;
        this.color = color;
    }

    draw(){
        context.beginPath();
        context.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        //context.rect(this.x, this.y, this.size, this.size);
        context.closePath();
        context.fill();
    }

    update(){
        context.fillStyle = this.color;
        let dx = mouse.x - this.x;
        let dy = mouse.y - this.y;
        let distance = Math.sqrt(dx * dx + dy * dy);
        let maxDistance = mouse.radius;
        let forceDirectionX = dx / distance;
        let forceDirectionY = dy / distance;
        let force = (maxDistance - distance) / maxDistance;
        let directionX = forceDirectionX * force * this.density;
        let directionY = forceDirectionY * force * this.density;
        if(distance < mouse.radius + this.size){
            this.x -= directionX;
            this.y -= directionY;
        }else{
            if(this.x != this.baseX){
                let dx = this.x - this.baseX;
                this.x -= dx/15;
            }
            if(this.y != this.baseY){
                let dy = this.y - this.baseY;
                this.y -= dy/15;
            }
        }
        this.draw();
    }
}

function initText(){
    particleArray = [];
    for(let y = 0; y < canvasData.height; y++){
        for(let x = 0; x < canvasData.width; x++){
            if(canvasData.data[(y * 4 * canvasData.width) + (x * 4 + 3)] >= 128){
                //const particleX = x * (window.innerWidth/textImage.width);
                //const particleY = y * (window.innerHeight/textImage.height);
                const particleX = x * 15;
                const particleY = y * 15;
                particleArray.push(new Particle(particleX, particleY, 'blue'));
            }/*else{
                const particleX = x * (window.innerWidth/textImage.width);
                const particleY = y * (window.innerHeight/textImage.height);
                particleArray.push(new Particle(particleX, particleY, 'white'));
            }*/
        }
    }
}

function initImage(){
    particleArray = [];
    for(let y = 0; y < canvasData.height; y++){
        for(let x = 0; x < canvasData.width; x++){
            const red = canvasData.data[(y * 4 * canvasData.width) + (x * 4)];
            const green = canvasData.data[(y * 4 * canvasData.width) + (x * 4 + 1)];
            const blue =  canvasData.data[(y * 4 * canvasData.width) + (x * 4 + 2)];
            const alpha = canvasData.data[(y * 4 * canvasData.width) + (x * 4 + 3)];
            const pixelColor = 'rgba(' + red + ',' + green + ',' + blue + ',' + alpha + ')';
            const dx = x * (window.innerWidth/textImage.width);
            const dy = y * (window.innerHeight/textImage.height);
            particleArray.push(new Particle(dx, dy, pixelColor));
        }
    }
}

function connectParticle(){
    let opacity = 1;
    for(let pA = 0; pA < particleArray.length; pA++){
        for(let pB = pA; pB < particleArray.length; pB++){
            const dx = particleArray[pA].x - particleArray[pB].x;
            const dy = particleArray[pA].y - particleArray[pB].y;
            const distance = Math.sqrt(dx * dx + dy * dy);
            opacity = 1 - (distance/55);
            if(distance < 55){
                context.strokeStyle = 'rgba(245,225,255,' + opacity + ')';
                context.lineWidth = 1.5;
                context.beginPath();
                context.moveTo(particleArray[pA].x, particleArray[pA].y);
                context.lineTo(particleArray[pB].x, particleArray[pB].y);
                context.stroke();
            }
        }
    }
}

function connectParticleMouse(){
    for(let pA = 0; pA < particleMouseArray.length; pA++){
        for(let pB = pA; pB < particleMouseArray.length; pB++){
            const dx = particleMouseArray[pA].x - particleMouseArray[pB].x;
            const dy = particleMouseArray[pA].y - particleMouseArray[pB].y;
            const distance = Math.sqrt(dx * dx + dy * dy);
            if(distance < 30){
                context.beginPath();
                context.strokeStyle = particleMouseArray[pA].color;
                context.lineWidth = 0.5;
                context.moveTo(particleMouseArray[pA].x, particleMouseArray[pA].y);
                context.lineTo(particleMouseArray[pB].x, particleMouseArray[pB].y);
                context.stroke();
                context.closePath();
            }
        }
    }
}

